'use strict';
import { registerLanguage } from '../_.contribution.js';
registerLanguage({
    id: 'swift',
    aliases: ['Swift', 'swift'],
    extensions: ['.swift'],
    mimetypes: ['text/swift'],
    loader: function () { return import('./swift.js'); }
});
